import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

import Navbar from './Components/navbar.js';

//Content section
export default class Content extends React.Component{
  constructor(props){
    super(props)
    this.state={
      currentTab:"0"
    }
  }
  getID = (id) =>{
    this.setState({currentTab:id})
  }

  render(){
    const content = [<Home/>,<Aboutme/>,<Photography/>];
    console.log("this is the tab number"+this.state.currentTab);
    return(
      <div className="tab-content" id="tabContent">
      <Navbar getID={this.getID}/>
      {content[this.state.currentTab]}
    	</div>
    );
  }
}

//Home Section
class Home extends React.Component{

  render(){
    return(
      <h1 className="text-center mt-4 mx-1 mx-md-0 headerStyle fontStyling"> This is homepage</h1>
    );
  }
}

//About me Section
class Aboutme extends React.Component{
  render(){
    return(
      <h1 className="text-center mt-4 mx-1 mx-md-0 headerStyle fontStyling"> This is about me section</h1>
    );
  }
}
//Photography Section
class Photography extends React.Component{
  render(){
    return(
      <h1 className="text-center mt-4 mx-1 mx-md-0 headerStyle fontStyling"> This is Photography section</h1>
    );
  }
}

ReactDOM.render(<Content/>, document.getElementById('contentSection'));
